    // const { candidates, setCandidates } = useCandidates();
    // console.log(candidates);
  const { candidates, setCandidates } = useCandidates();
  console.log(candidates, " from candidates component");

  return (
    <>
      <div> Candidates</div>
      { candidates.map ( (candidate) => 
        (<CandidateCard
          key={candidate}
          name={candidate.name}
          slogan={candidate.slogan}/>))
      }
    </>
  )
}

export default Candidates;
